import React from 'react';
import './sdkcomp.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit } from '@fortawesome/free-solid-svg-icons';

const SdkComponent = (props) => {
    const { data } = props;
    const { project, industry_domains, funnel_stages, project_role, project_type } = data;

    return (
        <div className="sdk-subcomponent-box">
            <div className='first-container'>
                <h1 className='project-name'>{project}</h1>
                <FontAwesomeIcon icon={faEdit} className='project-edit' />
            </div>
            <h1 className='project-domain'>{industry_domains}</h1>
            <h1 className='project-domain'>{funnel_stages}</h1>
            <div className='first-container'>
                <h1 className='project-name'>{project_role}</h1>
                <h1 className='project-name'>{project_type}</h1>
            </div>
        </div>
    );
}

export default SdkComponent;
